import { Modal } from 'antd';

const ModalInterface = ({ content, toggleModal, onChangeToggleModal }) => {
  return (
    <Modal
      header={null}
      visible={toggleModal}
      onCancel={onChangeToggleModal}
      footer={null}
    >
      {content}
    </Modal>
  );
};

export default ModalInterface;
